from typing import List


class TweetCounts(object):
    
    def __init__(self):
        self.data = collections.defaultdict(list)
    
    def recordTweet(self, tweetName, t):
        """
        :type tweetName: str
        :type time: int
        :rtype: None
        """
        self.data[tweetName].append(t)
    
    def getTweetCountsPerFrequency(self, freq, tweetName, startTime, endTime):
        """
        :type freq: str
        :type tweetName: str
        :type startTime: int
        :type endTime: int
        :rtype: List[int]
        """
        
        a = [t for t in self.data[tweetName] if startTime <= t <= endTime]
        a.sort()
        
        ans = []
        s = startTime
        d = 60 if freq == 'minute' else (3600 if freq == 'hour' else 60 * 60 * 24)
        while s  <= endTime:
            l, r = bisect.bisect_left(a, s), bisect.bisect_left(a, s+d)
            ans.append(r-l)
            s += d
        return ans
